import Link from 'next/link';
import Button from 'react-bootstrap/Button';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Navbar";
import Container from 'react-bootstrap/Container';
const services_array = ["Solutions", "Projects", "Gear", "Music", "Contact Me"];

const linkStyle = {
  marginRight: 15,
  color : "black"
}
const Title = () => {
  return (
    <Button variant="light" style={linkStyle}>
    <Link href={`/`}>
      <span>Prabhakar Mishra</span>
    </Link>
    </Button>
  );
}
const Header = () => {
  return (
    <Navbar bg="black" sticky="top" expand="lg">
      <Navbar.Brand><Title/></Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav"/>
      <Navbar.Collapse id="basic-navbar-nav">
        {services_array.map(service => (
          <Nav className="mr-auto">
              <Button variant="light" style={linkStyle}>
              <Link href={`/${(service.replace(" Me", ''))}`}>
                <span>{service}</span>
              </Link>
              </Button>
          </Nav>
        ))}
    </Navbar.Collapse>
  </Navbar>
);
}

export default Header



